import React from 'react'

const Pods = ({ pods }) => {
  return (
    <div>
      <center><h1>Pod List</h1></center>
      <p>{pods[0]}</p>
      {pods.map((pod) => (
          <div>
            <h5>{pod}</h5>
        </div>
      ))}
      {pods.map((pod) => (
          <div>
            <h5>{pod.Name}</h5>
            <h6>{pod.Namespace}</h6>
        </div>
      ))}
    </div>
  )
};

export default Pods
